INSERT INTO `noticias` VALUES (1,'SE PONE EN MARCHA EL XVII TORNEO NACIONAL DE FUTBOL INFANTIL!!','El pasado viernes 10 de Enero a las 11hs se realizo una conferencia de prensa en el salon de fiesta del club Atletico Ayacucho, en el cual se lanzo el 17 Torneo Nacional de Futbol Infantil que estara reservado para las clase 2007 y junto a el, se realizara el Torneo Paralelo para la clase 2009. Cabe mencionar que estan confirmadas las presencias de los mas prestigiosas instituciones del futbol de A.F.A. y Nacional de Uruguay. Los esperamos!!','Noticia1','2020-01-12'),(2,'TRISTE NOTICIA','Es dificil incorporar noticias que no quisieramos compartir y que nos han sorprendido tristemente. El tragico fallecimiento de Nicolas Trabella en estas ultimas horas, quien venia entrenando con el plantel 2007, con sus escasos 12 aos para jugar el XVII Torneo Nacional de Futbol Infantil. Sus compaeros y profes estan intentando superar el duelo porque hay que continuar. La familia albirroja acompaa a la famila Trabella en este dificil momento.','Noticia2','2020-02-05'),(3,'SE REALIZo EL SORTEO DE ZONAS DEL TORNEO NACIONAL DE FUTBOL INFANTIL!!','El pasado 8 de febrero desde las 20hs, se desarrollo el sorteo del Torneo Nacional sub-12 y del Torneo Paralelo sub-10 en nuestro salon que posee nuestra institucion, por lo que quedaron definidos los grupos en ambas categorias. En estos dias se publicara el cronograma de los partidos con las canchas y horarios correspondientes.','Noticia3','2020-02-08'),(4,'POSTERGADA LA INAUGURACIoN!!','Debido a inconevientes climaticos, la ceremonia inaugural se reprogramo para el dia viernes a las 19:50 hs. Ademas, se completaran durante el transcurso de la maana, aquellos partidos que el clima impidio que se realicen.','Noticia4','2020-02-13'),(5,'INAUGURACIoN OFICIAL!!','Luego de la postergacion por el mal clima del pasado jueves, se realizo la ceremonia inaugural con la presencia de los equipos participantes. En la misma se realizo un homenaje a Nicolas, jugador N3 del equipo anfitrion, quien perdiera la vida en un accidente dias atras. En un acto muy emotivo, por pedido de sus compaeros y decision de la comision directiva, se hizo entrega de su camiseta a la familia, ante un interminable aplauso del publico presente, la cual sera retirada durante la temporada actual.','Noticia5','2020-02-15'),(6,'VELEZ CAMPEON!!!','El Club Atletico Velez Sarsfield se consagro campeon del XVII Torneo Nacional de Futbol Infantil - Ciudad de Ayacucho -, tras vencer 2 a 1 en una final pareja, al Club Atetico Talleres de Cordoba. En cuanto al torneo paralelo categoria 2009, el campeon fue Gimnasia de Tandil, que vencio en los penales 5 a 3 a Alumni Azuleo, luego de empatar en 0 en los 60 minutos reglamentarios de la final. Salud campeones!!','Noticia6','2020-02-16'),(7,'UN AO MaS!!','Finalizo el XVII Torneo Nacional de Futbol Infantil. El Club Atletico Ayacucho agradece a todos aquellos, que de una manera u otra colaboran para que el torneo se realice con total exito. Agradece tambien a todos los equipos participantes, haciendo una mension especial a Talleres de Cordoba, Andes Talleres de Mendoza y Club Nacional de Futbol de Uruguay, por lo gran cantidad de kilometros recorridos, lo que engrandece nuestro torneo. La comision directiva se siente orgullosa por el trabajo realizado. Esperamos el ao proximo volver a encontrarnos y contar con la presencia de mas equipos.','Noticia7','2020-02-16'),(8,'La previa: antes del torneo','El pasado jueves se realizo en las instalaciones de nuestra institucion el sorteo para la organizacion de zonas que difinieron los enfrentamientos. La categoria 2009 luchara para quedarse con la nueva Copa Challenge.','Noticia8','2022-01-29'),(9,'Arranco el campeonato','Finalizando el martes, alrededor de las 21 hs., arribo a las puertas de la institucion del Albirrijo la primer delegacion. Luego de varias hora de viaje, se hizo presente Talleres de Cordoba, que un ao mas nos acompaa en el Torneo Nacional de Futbol Infantil - Ciudad de Ayacucho.','Noticia9','2022-02-08'),(10,'Velez y Talleres campeones','En el ultimo dia de competencia, Talleres se consagro campeon en la cetegoria 2008, la cual se disputo este año debido al conocido parate por la pandemia. Luego de una final muy pareja con Banfield que finalizo 1 a 1 en el tiempo reglamentario, fue la T quien se quedo con el campoenato tras una infartante definicion por penales por 9 a 8. Por su parte, el fortin fue quien se llevo el campeonato en la categoria 2009 luego de vencer a boca por 2 tantos contra 0.','Noticia10','2022-02-13'),(11,'Se realizo el sorteo','En el dia de ayer se realizo el sorteo de los grupos para el Torneo Nacional y Torneo Paralelo, como asi tambien el de la categoria Femenino. Ya quedo menos para que gire la pelota sobre el cesped. Los esperamos a todos desde el primero al cinco de febrero!','Noticia11','2023-01-20'),(12,'Comenzo el torneo!','Luego de una larga jornada, se completaron los resultados del dia 1, donde todas las miradas estuvieron en el partido interzonal que disputaron San Lorenzo y Estudiantes de La Plata. En un partido muy parejo con llegadas para ambos lados, y en el cual la lluvia tuvo un papel muy importante, fue 0 a 0 el resultado final. Mañana continuaremos con mas futbol y tambien con la Inauguracion oficial si la lluvia lo permite.. PH: DesorienteBlues','Noticia12','2023-02-01'),(13,'Jornada completa','A pesar de la intensa lluvia caida por la mañana, pudo completarse con normalidad todos los partidos del dia. Agredecemos a toda la gente que se hizo presente en los distintos escenarios. En el dia de mañana se completan los partidos de zonas y se definiran los cruces a jugarse el dia sabado! PH: DesorienteBlues','Noticia13','2023-02-02'),(14,'Finalizo la inauguaracion','Se completo con exito la Inauguracion oficial con una masiva presencia del publico. En la misma participaron la mayoria de los equipos del certamen, con la excepcion de aquellos clubes de la zona que viajan todos los dias. Mañana continuamos con mas futbol!!','Noticia14','2023-02-02'),(15,'Finalizada la anteúltima jornada','Se completaron todos los partidos del día y quedaron definidos todos los cruces para el dia domingo. En categoria 2010, la primer semifinal la protagonizaran Ferrocarril Oeste contra Talleres de Cordoba desde las 10 de la mañana. Mientras que 11:15 hs. trataran de acceder a la final Independiente y San Lorenzo. PH: DesorienteBlues','Noticia15','2023-02-04'),(17,'San Lorenzo campeon!!','El ciclon se consagro campeon del XIX Torneo Nacional de Futbol Infantil Ciudad de Ayacucho. Luego de una final pareja, era San Lorenzo quien buscaba un poco mas el arco rival, hasta que finalmente en los ultimos minutos del partido llego el gol que le da su primer torneo Ciudad de Ayacucho. En el resto de los torneo paralelos, Atletico Ayacucho se cosagro campeon en la categoria 2011, Independiente de Tandil fue el campeon en la categoria 2012, Atletico Las Flores se corono en 2013, mientras que el Leon se llevo el torneo femenino Categoria 2008. Salud campeones y los esperamos a todos el año que viene!!','Noticia17','2023-02-06'),(18,'Atletico Ayacucho campeon Categoria 2011','El Club Atletico Ayacucho se quedo con la Copa de Oro en la categoria 2011 luego de una excelente campaña, en la que vencio al Leon de Madariaga en la final desde los penales. Cuando Atletico se preparaba para gritar campeon en el tiempo reglamentario, ya que, si bien era una final pareja, parecia tener controlada, llego el empate del Leon en el ultimo minuto. Fue entonces desde los penales donde pudo inponerse Atletico convirtiendo todos sus penales, y con el arquero deteniendo un disparo. Felicitaciones a todos los chicos campeones y a disfrutar del titulo!','Noticia16','2023-02-05');
